import React from 'react';
export default function texter( ) {
  return (
    <>
    <div> 
      <h1>This is the best thing</h1> 
      <div class="mb-3">
          <label for="mytext" class="form-label">Example textarea</label>
          <textarea class="form-control" id="mytext" rows="7"></textarea>
      </div>
    </div>
    </>
  )
}
